import React from 'react'
import adminFunctions from './adminFunctions'


const Blogs = () => {

  const {state,setCurrentId} = adminFunctions() 

  return (
    state.map((blog) =>{
      const {_id, name, file, text,title} = blog

      return(
        <div className="container" key={_id}>
          <div className="container-fluid">
            <div className="row">
              <div className="col-md-12"  >
                <div className="admin-blog">
                  <div className="admin-blog-img">

                  {  
                  file.map((image, index) =>{
                    const {filepath} = image

                    return(
                      <div key={index}>
                        <img src={`http://localhost:5000/${filepath}`} alt="img" />
                      </div>
                    )
                  })
                  }
                  </div>
                  <div className="admin-blog-content">
                    <p className='' > BlogName: {name} </p>
                    <p className='' > Blogcontent: {text} </p>
                    <p className='' > Blogtitle: {title} </p>
                  </div>
                  <button 
                    className="" 
                    onClick={()=> setCurrentId(_id)}
                    >
                    <Link to="/Blogupdate">
                      edit
                    </Link>
                    </button>
                </div>
              </div>
            </div>
          </div>
        </div>


      )
    })
  )
}

export default Blogs
